INSERT INTO programma (dieuthinsi_programmatos, onoma_programmatos) VALUES ('Doloribus dicta numquam fuga repudiandae dolores voluptatem quidem.','Atque harum fugit et officia voluptatum.'),('Earum cupiditate nulla officiis sit qui impedit non.','Atque qui unde et adipisci totam.'),('Sed non odit sunt dolorem id.','Aut eum quia velit deserunt.'),('Ad qui quia qui numquam iusto ea.','Consequatur qui sunt corrupti eius expedita doloremque quis.'),('Molestias ut inventore ratione.','Cupiditate necessitatibus ipsum odit facere eos et.'),('Dolore quas magni ut incidunt.','Debitis molestias labore atque dicta.'),('At et quibusdam velit neque velit.','Deserunt sequi sint doloremque similique repellat sint minima minus.'),('Earum nostrum voluptatem delectus dolore nostrum et qui.','Dolore qui aut deleniti voluptatem.'),('Sit non veritatis consectetur iusto repellat aut.','Dolorem aliquid enim ab aliquid mollitia quam.'),('Aliquid autem sint porro temporibus doloremque voluptatem est placeat.','Eligendi quia mollitia error earum repudiandae ut.'),('Aut temporibus ab minus dolorem temporibus eos pariatur.','Et quibusdam id sint beatae odit et.'),('Iusto vel molestiae quod magnam expedita.','Et sit ab tempore dolorum rerum asperiores.'),('Vero ea mollitia qui repellendus eos adipisci.','Et voluptatum enim omnis labore.'),('Ratione cum voluptatibus ducimus ea.','Eveniet similique accusantium et odio animi optio magnam.'),('Numquam consequatur ea beatae ad.','Hic omnis consequatur tenetur omnis aut ea inventore.'),('Sed sit vitae fuga ullam quas ut.','Iusto illum quia nihil mollitia voluptatem amet id aliquam.'),('Commodi et blanditiis id ut ut.','Quia suscipit ut sunt sapiente beatae doloremque.'),('Itaque dolores ipsa hic odit autem et.','Quia temporibus totam provident qui ut.'),('Aut placeat expedita eaque ipsum.','Quia totam voluptatum dolore non numquam magnam.'),('Dolorem quia voluptatem repellat et id in deserunt.','Voluptate perspiciatis sint voluptas sunt tenetur eius velit ducimus.');
